import React from 'react';
import { Link } from 'react-router-dom';
import './NavigationBar.css';

function NavigationBar() {
  let authuser = sessionStorage.getItem('Key_Veriable')
  //console.log(authuser)
  if (authuser === 'ADMIN') {
    return (
      <div className="NavigationBar">
      <nav>
        <b>
          <Link className="te"  to="/adminafterlogin">ADMIN HOME </Link>
              <Link className="te"  to="/displayall">DISPLAY ALL </Link>
              <Link className="te"  to="/search">SEARCH </Link>
              <Link className="te"  to="/delete">DELETE </Link>
              <Link className="te"  to="/add">DELETE </Link>
              <Link className="te"  to="/manageemp">Manage Member</Link>
              <Link className="te"  to="/manageins">Manage Instruments</Link>
              <Link className="te"  to="/logout">LOGOUT </Link>
        </b>
      </nav>
      </div>
    )

  }
  else if (authuser === 'USER') {
    return (
      <div className="NavigationBar">
      <nav>
        <b>
          <Link className="te"  to="/userafterlogin">USER HOME </Link>
            <Link className="te"  to="/viewprofile">VIEW PROFILE </Link>
            <Link className="te"  to="/updateprofile">UPDATE </Link>
            <Link className="te"  to="/logout">LOGOUT </Link>
        </b>
      </nav>
      </div>
    )
  }
  else {
    return (
      <div className="NavigationBar">
      <nav>
        <b>
          <Link className="te"  to="/">HOME </Link>
              <Link className="te"  to="/reg">REG </Link>
              <Link className="te"  to="/login">LOGIN </Link>
              <Link className="te"  to="/about">ABOUT US </Link>
              <Link className="te"  to="/contact">CONTACT US </Link>
              <Link className="te"  to="/adminlogin">ADMIN LOGIN </Link>
        </b>
      </nav></div>
    )
  }
}

export default NavigationBar
